.er_photo {
  transform: rotate(-1.2deg);
  .photo {
  background: url('../assets/edgeryders_group.jpg') no-repeat center 15px #f7f8f8;
  background-size: 95%;
  height: 220px !important;
  padding-bottom: 80px;
  position: relative;
  border-radius: 10px;
  width: 90%;
  left: 5%;
  margin-top: 2%;
  &:before, &:after {
        z-index: -1;
        position: absolute;
        content: "";
        bottom: 15px;
        left: 10px;
        width: 50%;
        top: 80%;
        max-width: 300px;
        background: #777;
        box-shadow: 0 15px 10px #777;
        transform: rotate(-3deg);
      }
      &:after {
        transform: rotate(3deg);
        right: 10px;
        left: auto;
      }
      h3 {
        position: absolute;
        bottom: 6%;
        left: 0%;
        width: 100%;
        text-align: center;
        color: orangered;
        font-size: 1.1em;
        font-family: "Permanent Marker", cursive;
        }
}
}
